import React from 'react';
import { BrowserRouter, Route, Switch } from 'react-router-dom';

import { ThemeProvider } from '@mui/material/styles';
import theme from './components/UI/Theme';
import Header from './components/Layout/Header';


function App() {
  return (
    <ThemeProvider theme={theme}>
      <BrowserRouter>
        <Header />
        <Switch>
          <Route exact path="/" component={() => <div>Home</div>} />
          <Route exact path="/innovation-lab" component={() => <div>Innovation Lab</div>} />
          <Route exact path="/submission-form" component={() => <div>Submit an Idea</div>} />
          <Route exact path="/tech-connect" component={() => <div>What's New</div>} />
          <Route exact path="/about-us" component={() => <div>About Us</div>} />
          <Route exact path="/contact" component={() => <div>Contact Us</div>} />
        </Switch>
      </BrowserRouter>
    </ThemeProvider>
  );
}

export default App;
